import { ButtonGradient } from "@Components";
import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  buttonContainer: {
    alignItems: "center",
    justifyContent: "center",
    paddingTop: 14,
    paddingBottom: 14
  },
  buttonText: {
    paddingTop: 0,
    fontSize: 14,
    lineHeight: 20
  },
  buttonNomalBorder: {
    borderRadius: 100,
    borderWidth: 1,
    borderColor: "#E5E5E5"
  },
  ButtonGradientRadius: {
    overflow: "hidden",
    borderRadius: 100,
    alignItems: "center"
  }
});

export default styles;
